(2640, 'esMX', 'Caldero Carnicero', 'A lo largo de la historia, ha habido muchas guerras épicas, pero ninguna tan explosiva como la que desató la rivalidad entre el gorila galvánico Torq, la Tempestad, y el mecasaurio fundido Fogorrex, el Furioso. ¡Esta noche, todo puede pasar cuando estos dos campeones luchen en el Caldero en un enfrentamiento que amenaza con partir Minahonda en dos! Mira la carnicería o conviértete en la vergüenza de la goblinidad.', 59888);
