(30331, 'esMX', 'Resumen', 'Fogorrex y Torq dan un gran espectáculo en el que lanzan |cFF2959D3|Hspell:473650|h[Bombas de chatarra]|h|r y afectan a los combatientes de la arena con |cFF2959D3|Hspell:473951|h[Carga estática]|h|r. \nCuando alcanzan 100 p. de energía, Fogorrex y Torq producen un |cFF2959D3|Hspell:465833|h[Choque colosal]|h|r.', 59888),
(27555, 'esMX', 'Sanadores', '$bullet; Cuando expira, |cFF2959D3|Hspell:424739|h[Corrupción caótica]|h|r estalla y salta al jugador más cercano.\n$bullet;|cFF2959D3|Hspell:424739|h[Corrupción caótica]|h|r inflige un daño periódico moderado a su objetivo actual.\n$bullet;|cFF2959D3|Hspell:425052|h[Gravedad oscura]|h|r inflige un daño moderado a todos los jugadores mientras dura.', 59888),
(30489, 'esMX', 'Infligidores de daño', '$bullet;|cFF2959D3|Hspell:465952|h[Bombuchas brutales]|h|r y |cFF2959D3|Hspell:1214607|h[Bombazo bombástico]|h|r también activan |cFF2959D3|Hspell:466158|h[Cartera de zapador]|h|r y |cFF2959D3|Hspell:1214755|h[Cohetes sobrecargados]|h|r.\n$bullet;Los técnicos mechaoscura moribundos dejan gigabombas que hacen |cFF2959D3|Hspell:1223905|h[¡GigaBUM!]|h|r después de $1223905D. La |cFF2959D3|Hspell:469327|h[Gigaexplosión]|h|r de Gallywix hace que detonen de inmediato.\n$bullet;Cada |cFF2959D3|Hspell:469362|h[Gigabomba cargada]|h|r que llega a los gigacontroles activa una |cFF2959D3|Hspell:469767|h[Detonación de gigabomba]|h|r que causa una |cFF2959D3|Hspell:1220846|h[Pérdida de control]|h|r que interrumpe las |cFF2959D3|Hspell:469286|h[Gigabobinas]|h|r de Gallywix.\n$[15,16$bullet;El centinela tiroseguro puede infligir un gran daño con |cFF2959D3|Hspell:466834|h[Tromba de choque]|h|r si no se lo controla.$]', 59888),
(30488, 'esMX', 'Sanadores', '$bullet;Los jugadores afectados por |cFF2959D3|Hspell:1220761|h[Latas de mecaingeniero]|h|r detonan cuando se consume o expira, lo que causa una |cFF2959D3|Hspell:474447|h[Detonación de lata]|h|r.\n$bullet;Los técnicos mechaoscura moribundos dejan gigabombas que hacen |cFF2959D3|Hspell:1223905|h[¡GigaBUM!]|h|r después de $1223905D. La |cFF2959D3|Hspell:469327|h[Gigaexplosión]|h|r de Gallywix hace que detonen de inmediato.\n$bullet;Cada |cFF2959D3|Hspell:469362|h[Gigabomba cargada]|h|r que llega a los gigacontroles activa una |cFF2959D3|Hspell:469767|h[Detonación de gigabomba]|h|r que causa una |cFF2959D3|Hspell:1220846|h[Pérdida de control]|h|r que interrumpe las |cFF2959D3|Hspell:469286|h[Gigabobinas]|h|r de Gallywix.\n$bullet;|cFF2959D3|Hspell:469286|h[Gigabobinas]|h|r, |cFF2959D3|Hspell:466338|h[Zumbadores carbonizadores]|h|r y |cFF2959D3|Hspell:1214369|h[¡¡¡DESTRUCCIÓN TOTAL!!!]|h|r infligen un daño considerable.', 59888),
(30487, 'esMX', 'Tanques', '$[15,16$bullet;|cFF2959D3|Hspell:465952|h[Bombuchas brutales]|h|r y |cFF2959D3|Hspell:1214607|h[Bombazo bombástico]|h|r también crean |cFF2959D3|Hspell:466165|h[Mina \"dañada\" de 1500 kilos]|h|r.$]\n$bullet;|cFF2959D3|Hspell:466340|h[Latas dispersivas]|h|r y |cFF2959D3|Hspell:1214607|h[Bombazo bombástico]|h|r afectan a los jugadores que se encuentran en línea recta frente a Gallywix.\n$bullet;Los técnicos mechaoscura moribundos dejan gigabombas que hacen |cFF2959D3|Hspell:1223905|h[¡GigaBUM!]|h|r después de $1223905D. La |cFF2959D3|Hspell:469327|h[Gigaexplosión]|h|r de Gallywix hace que detonen de inmediato.\n$bullet;Gallywix hace uso de todos los |cFF2959D3|Hspell:1220290|h[Disparos con truco]|h|r cuando alcanza $1220290s2 acumulaciones o cuando cambia de objetivos principales.', 59888),
