(31173, 'esMX', 'Intermedio: Armado y atracado', 'Gallywix cae sobre la arena, lo que provoca un |cFF2959D3|Hspell:1214226|h[Impacto hendedor]|h|r que afecta a cualquiera que esté en su camino y le otorga |cFF2959D3|Hspell:1214229|h[Blindaje de clase Armagedón]|h|r. Luego, lanza |cFF2959D3|Hspell:1214369|h[¡¡¡Destrucción total!!!]|h|r hasta que lo interrumpan.', 59888),
