(30498, 'esMX', 'Fase uno: ¡Qué arsenal!', '\"Puedo asegurarte que nadie talla tu cara en una montaña si te dejas zarandear por los demás\".\n\nGallywix pulveriza a sus enemigos con su arsenal mejorado.', 59888),
