(31956, 'esMX', 'Infligidores de daño', '$bullet;Las |cFF2959D3|Hspell:468846|h[Chispas saltarinas]|h|r persiguen a los jugadores y los aturden al tocarlos.\n$bullet;El |cFF2959D3|Hspell:465279|h[Agua de presa]|h|r se electrifica cuando entra en contacto con las habilidades de relámpago de Geezle.\n$bullet;|cFF2959D3|Hspell:465463|h[Carga turbo]|h|r y |cFF2959D3|Hspell:468813|h[Gigazap]|h|r infligen un gran daño.', 59888),
(31102, 'esMX', 'Tanques', '$bullet; Rik libera una |cFF2959D3|Hspell:466128|h[Resonancia]|h|r que otorga más potencia a los amplificadores cercanos. \n$bullet; |cFF2959D3|Hspell:464488|h[Explosión sónica]|h|r inflige daño sónico en un cono frontal y aplica |cFF2959D3|Hspell:464518|h[Tinnitus]|h|r. El daño sónico no se puede bloquear ni reducir por la armadura.\n$bullet; Los |cFF2959D3|Hspell:466722|h[¡Estallidos sónicos!]|h|r de los amplificadores lanzan a los jugadores por los aires a la vez que Rik genera |cFF2959D3|Hspell:467991|h[Caídas estruendosas]|h|r.', 59888),
(30506, 'esMX', 'Tanques', '$bullet;|cFF2959D3|Hspell:466518|h[Nudillos de oro fundido]|h|r inflige un gran daño frente a Rob y aplica |cFF2959D3|Hspell:467202|h[Goteo dorado]|h|r a los jugadores golpeados.\n$bullet;El daño de |cFF2959D3|Hspell:469490|h[Disparo dobledaño]|h|r es menor contra el jugador más cercano.', 59888),
(30486, 'esMX', 'Resumen', 'Gallywix obtiene energía con el tiempo y activa las |cFF2959D3|Hspell:469286|h[Gigabobinas]|h|r de la Casa del Cromado con máxima capacidad. Cada |cFF2959D3|Hspell:469362|h[Gigabomba cargada]|h|r que llega a los gigacontroles activa una |cFF2959D3|Hspell:469767|h[Detonación de gigabomba]|h|r. Esto causa una |cFF2959D3|Hspell:1220846|h[Pérdida de control]|h|r que interrumpe las |cFF2959D3|Hspell:469286|h[Gigabobinas]|h|r de Gallywix. Después de perder los dos gigacontroles, se forma una |cFF2959D3|Hspell:1215209|h[Zona de sabotaje]|h|r.\n\nAdemás, a lo largo del encuentro, Gallywix llama a los compinches mechaoscura mejor pagados para que lo ayuden.\n\nMientras la batalla continúa, Gallywix modifica y potencia su arsenal y desata un caos maniático.$[14,15,17$ Cuando le queda un 50% de salud, Gallywix mejora sus capacidades para eliminar a los jugadores de una vez por todas. $]', 59888),
(30082, 'esMX', 'Sanadores', '$bullet;Si durante |cFF2959D3|Hspell:461060|h[¡Gira para ganar!]|h|r no se depositan dos símbolos o se detecta una combinación repetida, el bandido manco usa |cFF2959D3|Hspell:461068|h[¡Fraude detectado!]|h|r.\n$bullet;|cFF2959D3|Hspell:460164|h[Emanaciones viles]|h|r reduce la velocidad de movimiento de todos los jugadores y absorbe una gran cantidad de sanación.\n$bullet;Quedarse cerca de la ficha de |cFF2959D3|Hspell:460181|h[Fila ganadora]|h|r otorga |cFF2959D3|Hspell:460444|h[¡Gran jugador!]|h|r.', 59888),
(31381, 'esMX', 'Sección 45', '', 59888),
(31380, 'esMX', 'Sección 44', '', 59888),
(30951, 'esMX', 'Sanadores', '$bullet;Las bombas de tiempo que crea |cFF2959D3|Hspell:460867|h[¡Gran badaBUM!]|h|r infligen una gran cantidad de daño a todos los jugadores si dejan que expiren.\n$bullet;|cFF2959D3|Hspell:459779|h[Arremetida descontrolada]|h|r hace que Bront atraviese todo objeto a su paso, incluidas las bombas de tiempo que crea |cFF2959D3|Hspell:460867|h[¡Gran badaBUM!]|h|r.\n$bullet;$[8,23|cFF2959D3|Hspell:473690|h[Gel explosivo cinético]|h|r lanza por los aires las bombas de tiempo cercanas cuando se disipa.$]', 59888),
(30950, 'esMX', 'Tanques', '$bullet;Las bombas de tiempo que crea |cFF2959D3|Hspell:460867|h[¡Gran badaBUM!]|h|r infligen una gran cantidad de daño a todos los jugadores si dejan que expiren.\n$bullet;|cFF2959D3|Hspell:459779|h[Arremetida descontrolada]|h|r hace que Bront atraviese todo objeto a su paso, incluidas las bombas de tiempo que crea |cFF2959D3|Hspell:460867|h[¡Gran badaBUM!]|h|r.', 59888),
(30949, 'esMX', 'Infligidores de daño', '$bullet;Las bombas de tiempo que crea |cFF2959D3|Hspell:460867|h[¡Gran badaBUM!]|h|r infligen una gran cantidad de daño a todos los jugadores si dejan que expiren.\n$bullet;|cFF2959D3|Hspell:459779|h[Arremetida descontrolada]|h|r hace que Bront atraviese todo objeto a su paso, incluidas las bombas de tiempo que crea |cFF2959D3|Hspell:460867|h[¡Gran badaBUM!]|h|r.\n$bullet;$[8,23|cFF2959D3|Hspell:473690|h[Gel explosivo cinético]|h|r lanza por los aires las bombas de tiempo cercanas cuando se disipa.$]', 59888),
