(31132, 'esMX', 'Infligidores de daño', '$bullet; Kul\'tharok arranca el alma de los jugadores con |cFF2959D3|Hspell:473959|h[Extraer alma]|h|r. Si el alma llega a Kul\'tharok, le infunde energía necrótica que causa |cFF2959D3|Hspell:474013|h[Corrupción de alma]|h|r.\n$bullet; |cFF2959D3|Hspell:1216474|h[Espiral mortífera]|h|r crea un orbe de nigromancia giratorio que inflige daño de las sombras a los jugadores que toca.', 59888),
(28414, 'esMX', 'Resumen', 'El maestro cervecero Aldryr aprovecha el poder explosivo del hidromiel cinéreo y ataca a los jugadores con |cFF2959D3|Hspell:432198|h[Eructo ardiente]|h|r y |cFF2959D3|Hspell:432182|h[Lanzar hidromiel cinéreo]|h|r.\n\nCuando llega a un 66% o un 33% de salud, el maestro cervecero Aldryr hace comenzar la |cFF2959D3|Hspell:442525|h[Hora feliz]|h|r y provoca que los parroquianos sedientos suelten un |cFF2959D3|Hspell:431896|h[Grito alborotador]|h|r.', 59888),
(22652, 'esMX', 'Infligidores de daño', '$bullet;|cFF2959D3|Hspell:333292|h[Muerte abrasadora]|h|r inflige daño a los aliados cercanos.\n$bullet;Cuando alcanza los 100 p. de energía, Paceran marca como objetivos a los jugadores con |cFF2959D3|Hspell:320182|h[Esporas nocivas]|h|r.', 59888),
(22650, 'esMX', 'Tanque', '$bullet;|cFF2959D3|Hspell:320069|h[Golpe mortal]|h|r reduce toda la sanación recibida.\n$bullet;Cuando alcanza los 100 p. de energía, Paceran marca como objetivos a los jugadores con |cFF2959D3|Hspell:320182|h[Esporas nocivas]|h|r.', 59888),
