(21579, 'esMX', 'Sanador', '$bullet;|cFF2959D3|Hspell:320069|h[Golpe mortal]|h|r reduce toda la sanación recibida.\n$bullet;|cFF2959D3|Hspell:333292|h[Muerte abrasadora]|h|r inflige daño a los aliados cercanos.\n$bullet;|cFF2959D3|Hspell:1215600|h[Toque marchitante]|h|r inflige daño de las sombras de forma continua a los jugadores objetivos hasta que se disipe.', 59888),
(21577, 'esMX', 'Resumen', 'Derrota a los tres contendientes para demostrar tu valía. Cada uno desata una habilidad poderosa cuando alcanza los 100 p. de energía.', 59888),
