INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2345, 'esMX', 'Meeksi peluchái', '|cFFFFD200Tienda del juego|r|n', 'Los peluchái son famosos por sus tés aromáticos. Sin embargo, al ser tan juguetones, se la pasan derramando el té.', 59888),
(2344, 'esMX', 'Meeksi patarrodante', '|cFFFFD200Tienda del juego|r|n', 'Los patarrodante cumplen sus tareas de dispensamiento de té con orgullo. Siempre están dispuestos a servir una taza de té caliente a sus compañeros de viaje.', 59888),
(2343, 'esMX', 'Meeksi patasuave', '|cFFFFD200Tienda del juego|r|n', 'Los patasuave ofrecen un té negro que es ideal para despertarse por la mañana o para quedarse hasta altas horas de la noche.', 59888),
(2342, 'esMX', 'Meeksi pelocrespo', '|cFFFFD200Tienda del juego|r|n', 'Los pelocrespo son juguetones, torpes y están obsesionados con la limpieza. Es una combinación peligrosa de atributos.', 59888),
(2489, 'esMX', 'Mariposa perlescente', '|cFFFFD200Puesto de venta|r', 'Asciende a los cielos sobre una mariposa brillante, resplandeciente y lustrosa.', 59888),
(2288, 'esMX', 'C.H.A.T.A.R.R.A.dora goblin personalizada', '|cFFFFD200Botín:|r Pila de basura tamizada|n|cFFFFD200Zona:|r Minahonda', 'Las trituradoras goblin han demostrado una y otra vez que tienen muchas aplicaciones, como el paisajismo y el transporte. Este modelo ha sido adaptado para las necesidades de C.H.A.T.A.R.R.A.', 59888),
(2346, 'esMX', 'Meeksi robabrebaje', '|cFFFFD200Tienda del juego|r|n', 'A pesar de su naturaleza traviesa y juguetona, estas criaturas son compañeros de viaje fieles y confiables.', 59888),
(2296, 'esMX', 'Goblinave de surcabismos', '|cFFFFD200Misión de mundo: |rQue me devuelvan mi sombrero|n|cFFFFD200Zona: |rIsla de Dorn|n|cFFFFD200Zona: |rDornogal', '¡Esta aeronave te permitirá adentrarte en la aventura, si es que no explota!', 59888),
(2279, 'esMX', 'Cohetoide fallido', '|cFFFFD200Vendedor: |rAndo, el Gatillero|n|cFFFFD200Zona: |rLiberación de Minahonda|n|cFFFFD200Costo: |r500|TINTERFACE\\MONEYFRAME\\UI-GOLDICON.BLP:0|t', 'Recuperado de las gradas del Caldero durante un enfrentamiento particularmente cruento. Cuando le preguntaron si fue un error que no haya explotado, el operador de Torq solo respondió: \"Es probable\".', 59888),
(2276, 'esMX', 'Compactadente mechaoscura', '|cFFFFD200Vendedor: |rAndo, el Gatillero|n|cFFFFD200Zona: |rLiberación de Minahonda|n|cFFFFD200Costo: |r500|TINTERFACE\\MONEYFRAME\\UI-GOLDICON.BLP:0|t', 'La madre de todas las hienas de basural de Stix. Sus mandíbulas son capaces de destrozar cualquier cosa (o cualquier persona) de la que Gallywix quiera deshacerse.', 59888),
(1471, 'esMX', 'Venganza', '|cFFFFD200Botín:|r Lady Sylvanas Brisaveloz|n|cFFFFD200Zona:|r Sagrario de Dominación|n|cFFFFD200Difficulty:|r Mítica', 'Sylvanas perdió una parte de sí misma el día que Arthas le quitó la vida, y la oscuridad en su interior creció para llenar ese vacío.', 59888);
